import React from 'react';
import '../styles/EmergencyHelpline.css';

const helplines = [
  { title: 'National Emergency', number: '112' },
  { title: 'Police', number: '100' },
  { title: 'Fire Brigade', number: '101' },
  { title: 'Ambulance', number: '102' },
  { title: 'Disaster Management', number: '108' }
];

function EmergencyHelpline() {
  return (
    <section id="helpline" className="emergency-helpline">
      <h2>Emergency Helplines</h2>
      <div className="helpline-grid">
        {helplines.map((helpline, index) => (
          <div key={index} className="helpline-card slide-up">
            <div className="helpline-icon">
              <i className={`fas fa-${index === 0 ? 'phone-alt' : 
                index === 1 ? 'shield-alt' : 
                index === 2 ? 'fire' : 
                index === 3 ? 'ambulance' : 'exclamation-triangle'}`}></i>
            </div>
            <h3>{helpline.title}</h3>
            <p className="phone">{helpline.number}</p>
            <a href={`tel:${helpline.number}`} className="call-button">
              Call Now
            </a>
          </div>
        ))}
      </div>
    </section>
  );
}

export default EmergencyHelpline;
